import React from 'react'
import Header from './Header'
import Card from './Card'
const MainPage = () => {
    let details =[
            {
                title: "Anmol",
                content: "Anmol is a boy who lives in dasuya city distt hoshiarpur"
            },
            {
                title: "Jaspreet",
                content: "Jaspreet is a g who lives in dasuya city distt hoshiarpur"
            },
            {
                title: "Anmol",
                content: "Anmol is a boy who lives in dasuya city distt hoshiarpur"
            },
        ]
    return (
        <div>
            <Card details={details} />

        </div>
    )
}

export default MainPage


